const LoaderColors = () => {
  return (
    <div className='LoaderColors loading-wrap gamba-circles'>
      <div className='circle' />
      <div className='circle' />
      <div className='circle' />
      <div className='circle' />
      <style jsx>
        {`
          .loading-wrap.gamba-circles {
            width: 200px;
            height: 200px;
          }

          .loading-wrap.gamba-circles .circle {
            border: 8px solid transparent;
            mix-blend-mode: screen;
          }

          .loading-wrap.gamba-circles .circle:nth-child(1) {
            border-color: #db4437;
          }

          .loading-wrap.gamba-circles .circle:nth-child(2) {
            border-color: #f4b400;
          }

          .loading-wrap.gamba-circles .circle:nth-child(3) {
            border-color: #86bc42;
          }

          .loading-wrap.gamba-circles .circle:nth-child(4) {
            border-color: #4285f4;
          }

          .gamba-circles {
            position: absolute;
            top: 50%;
            left: 50%;
            width: 80px;
            height: 80px;
            margin: 0 auto;
            -webkit-transform: translate3d(-50%, -50%, 0);
            -moz-transform: translate3d(-50%, -50%, 0);
            -ms-transform: translate3d(-50%, -50%, 0);
            -o-transform: translate3d(-50%, -50%, 0);
            transform: translate3d(-50%, -50%, 0);
          }

          .gamba-circles .circle {
            position: absolute;
            box-sizing: border-box;
            width: 100%;
            height: 100%;
            -webkit-transition: all 0.5s ease;
            -moz-transition: all 0.5s ease;
            -o-transition: all 0.5s ease;
            transition: all 0.5s ease;
            border: 1px solid transparent;
            border-radius: 92% 110% 132% 88%;
          }

          .gamba-circles .circle:nth-child(1) {
            -webkit-transform-origin: 50% 50%;
            -ms-transform-origin: 50% 50%;
            transform-origin: 50% 50%;
            -webkit-animation: spin1 6s linear infinite;
            animation: spin1 6s linear infinite;
            border-color: #c7c7c7;
          }

          .gamba-circles .circle:nth-child(2) {
            -webkit-transform-origin: 50% 50%;
            -ms-transform-origin: 50% 50%;
            transform-origin: 50% 50%;
            -webkit-animation: spin2 6s linear infinite;
            animation: spin2 6s linear infinite;
            border-color: #c7c7c7;
          }

          .gamba-circles .circle:nth-child(3) {
            -webkit-transform-origin: 50% 50%;
            -ms-transform-origin: 50% 50%;
            transform-origin: 50% 50%;
            -webkit-animation: spin3 6s linear infinite;
            animation: spin3 6s linear infinite;
            border-color: #c7c7c7;
          }

          .gamba-circles .circle:nth-child(4) {
            -webkit-transform-origin: 50% 50%;
            -ms-transform-origin: 50% 50%;
            transform-origin: 50% 50%;
            -webkit-animation: spin4 6s linear infinite;
            animation: spin4 6s linear infinite;
            border-color: #c7c7c7;
          }

          @-webkit-keyframes spin1 {
            0% {
              -webkit-transform: rotate(0);
              transform: rotate(0);
            }

            100% {
              -webkit-transform: rotate(360deg);
              transform: rotate(360deg);
            }
          }

          @keyframes spin1 {
            0% {
              -webkit-transform: rotate(0);
              transform: rotate(0);
            }

            100% {
              -webkit-transform: rotate(360deg);
              transform: rotate(360deg);
            }
          }

          @-webkit-keyframes spin2 {
            0% {
              -webkit-transform: rotate(72deg);
              transform: rotate(72deg);
            }

            100% {
              -webkit-transform: rotate(-288deg);
              transform: rotate(-288deg);
            }
          }

          @keyframes spin2 {
            0% {
              -webkit-transform: rotate(72deg);
              transform: rotate(72deg);
            }

            100% {
              -webkit-transform: rotate(-288deg);
              transform: rotate(-288deg);
            }
          }

          @-webkit-keyframes spin3 {
            0% {
              -webkit-transform: rotate(-144deg);
              transform: rotate(-144deg);
            }

            100% {
              -webkit-transform: rotate(216deg);
              transform: rotate(216deg);
            }
          }

          @keyframes spin3 {
            0% {
              -webkit-transform: rotate(-144deg);
              transform: rotate(-144deg);
            }

            100% {
              -webkit-transform: rotate(216deg);
              transform: rotate(216deg);
            }
          }

          @-webkit-keyframes spin4 {
            0% {
              -webkit-transform: rotate(216deg);
              transform: rotate(216deg);
            }

            100% {
              -webkit-transform: rotate(-144deg);
              transform: rotate(-144deg);
            }
          }

          @keyframes spin4 {
            0% {
              -webkit-transform: rotate(216deg);
              transform: rotate(216deg);
            }

            100% {
              -webkit-transform: rotate(-144deg);
              transform: rotate(-144deg);
            }
          }
        `}
      </style>
    </div>
  );
};

export default LoaderColors;
